create table employee (
	social_security_num VARCHAR(50) PRIMARY KEY,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	street_num VARCHAR(50),
	city VARCHAR(50),
	country VARCHAR(50),
	job VARCHAR(20),
	current_airport_code VARCHAR(3),
	sick_leave INT,
    vacation_days INT
);

